import React from 'react';

export default function Header() {
  return (
    <header>
      <div className='container'>
  <nav className="navbar navbar-expand-lg navbar-light bg-light">
  <div className="navbar-brand " href="#"><img className="w-25" src='https://upload.wikimedia.org/wikipedia/commons/thumb/c/cf/Flag_of_Canada.svg/800px-Flag_of_Canada.svg.png?20190318175205' /></div>
  

    <div className='ms-auto me-4'>
    <h4 className="text-center">Projet final</h4>
    <h5 className="text-center">Outils de programation web</h5>
    <h6 className="text-center">Creer par: Imane Berkoune et Alexandru Constantin</h6>
    <h6 className="text-center">Cegep Gerald Godin</h6>

  </div>
    
    
  
</nav>
</div>
</header>
  );
};
